(33, 'KD-190122-005', 36, '74042718291238', 'Tidak Ada', 'Tidak Ada', 64, 176, '120/100', 'AB', '<p>Diagnosis karies gigi dimulai dengan anamnesis berupa nyeri pada gigi, gigi berlubang, perubahan warna gigi dan bau mulut. Pada pemeriksaan fisik dapat ditemukan plak, lesi, dan lubang pada gigi. berdasarkan inspeksi pada permukaan gigi. Berdasarkan tanda dan gejala pasien juga dapat membantu klinisi dalam menentukan tingkat keparahan karies gigi pada pasien.</p>\r\n\r\n<p>Tanda dan gejala karies gigi sangat beragam dan sangat bergantung pada tingkat keparahan dan lokasi karies gigi. Umumnya, pasien dengan karies gigi tidak memiliki gejala. Akan tetapi, apabila sudah terjadi kerusakan lanjut, terutama sampai akar gigi, maka&nbsp; pasien akan merasakan gejala:</p>\r\n\r\n<ul>\r\n	<li>Nyeri tajam pada gigi</li>\r\n	<li>Nyeri gigi yang memberat dengan makan atau minum sesuatu yang bersifat dingin, panas, atau manis. Hal ini yang sering disebut sebagai gigi sensitif.</li>\r\n	<li>Lubang pada gigi</li>\r\n	<li>Warna gigi berubah menjadi putih, coklat, atau hitam</li>\r\n	<li>Bau mulut dan mulut terasa bau busuk [1,4,5]</li>\r\n</ul>\r\n\r\n<p>Apabila ditemukan gejala-gejala seperti demam, nyeri kepala, pembengkakan pada sekitar mata unilateral, nyeri atau nyeri tekan pada dasar mulut, dan sulit menelan maka kemungkinan sudah terjadi komplikasi pada pasien karies gigi dan membutuhkan tindakan segera.</p>\r\n', '2022-01-20 06:38:01'),
(34, 'KD-190821-003', 37, '7472064305770004', 'TIDAK ADA', 'TIDAK ADA', 49, 160, '110/70', 'O', '<p>26 car-o. car profunda</p>\r\n\r\n<p>sondasi (-)</p>\r\n\r\n<p>perkusi (-)</p>\r\n\r\n<p>palpasi (-)</p>\r\n', '2022-01-20 09:14:08'),
(35, 'KD-190821-003', 38, '9208014408000002', 'Tidak Ada', 'Tidak Ada', 64, 150, '937/0', '-', '<p>11 21 car media. car. mesial</p>\r\n\r\n<p>sondasi +</p>\r\n\r\n<p>perkusi -</p>\r\n\r\n<p>palpasi -</p>\r\n', '2022-01-20 12:02:00'),
